import React, { Component } from 'react';
import { BrowserRouter, Switch, Route, Link, Redirect, withRouter } from 'react-router-dom'
import logo from './logo.svg';
import './App.css';
import Profile from './Profile';
//
// <Link to="/profile">  Sam </Link>
// <Switch>
//   <Route exact path='/profile' component={Profile}/>
// </Switch>

class Home extends Component {
  constructor(props) {

    super(props);

    this.state = {
      toProfile: false,
    }

    this.routeChange = this.routeChange.bind(this);

  }

  routeChange(event) {
    //this.setState({toProfile: true});
    event.preventDefault()
    console.log("succesfully here!?");

    fetch("http://localhost:5000/check", {
      mode: 'cors',
      credentials: 'include',
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
        'Access-Control-Allow-Credentials': true,
      }
    }).catch(err => {
      // handle err
      console.log("this bitch did not work")
    })
  }

  render() {
    if (this.state.toProfile === true){
      return (
        <Redirect to="/profile" />
      );
    }

    return (

      <div className = "container">
        <div className = "top-bar">
          <div className = "bar">
            <div className = "menu"></div>
            <div className = "menu"></div>
            <div className = "menu"></div>
          </div>
        </div>


        <div className = "user">
          <div id = "circle"> </div>
          <div id = "name" onClick = {this.routeChange}> Sam  </div>
        </div>

        <table>
      <tbody>
    <tr>
        <td>
          <div className = "dumb-box">
            <div className="medicine">
            <img  src={require("./images/stolen.png")}
            alt="pill" width="40" height="40"/>
          <p> Medicine #1</p>
          </div>
          <div id = "small-circle"></div>
          </div>
        </td>
    </tr>
    <tr>
        <td>
          <div className = "dumb-box">
            <div className = "medicine">
            <img  src={require("./images/stolen.png")}
            alt="pill" width="40" height="40"/>
          <p> Medicine #2 </p>
          </div>
          <div id = "small-circle"></div>
          </div>
        </td>
    </tr>
    </tbody>
    </table>

    <div className = "reward">
      <div className= "inner">
        <img
        src={require("./images/icecream.png")} alt="icecweam"
        width="40" height="40"/>

        <div className = "name-progress">
          <p> Target: Ice cream </p>
          <div className = "progress">
            <div className="progress-circle">1</div>
            <div className="progress-circle">2</div>
            <div className="progress-circle">3</div>
            <div className="progress-circle">4</div>
            <div className="progress-circle">5</div>
          </div>
        </div>
      </div>
    </div>

      <table id = "calendar">
        <tbody>
        <tr id = "days-of-week">
          <td> <div className = "day-container">Sat</div></td>
          <td> <div className = "day-container">Sun</div></td>
          <td> <div className = "day-container">Mon</div></td>

        </tr>
        <tr >
          <td> <div className="circle-wrapper"> <div className = "circly"> </div> </div></td>
          <td> <div className="circle-wrapper"><div className = "circly"> </div></div></td>
          <td> <div className="circle-wrapper"><div className = "circly"> </div></div></td>

          </tr>
        </tbody>
      </table>

      </div>

    );
  }
}

export default Home;
